import math
dp = [1]
for i in range(1, 1000005):
    dp.append(math.log(i) + dp[i - 1])

def calculate_teaching_probability(n, m, p, k):
    if p == 0 or (n % 2 == 0 and m % 2 == 0):
        return 1.0
    elif n % 2 == 1 and m % 2 == 1:
        return 0.0
    else:
        P = 0
        kln2 = k * math.log(2)
        for i in range(p, k + 1):
            lnPi = dp[k] - dp[i] - dp[k - i] - kln2
            Pi = pow(math.e, lnPi)
            P += Pi
        return P

